row.EN-Gloss:
composed of people from or at home in many parts of the world; especially not provincial in attitudes or interests; "his cosmopolitan
    benevolence impartially extended to all races and to all creeds"- T.B. Macaulay; "the ancient and cosmopolitan societies of Syria and Egypt";
    "that queer, cosmopolitan, rather sinister crowd found around the Marseilles docks"

(used of persons or artifacts) marked by independence and creativity in thought or action; "an imaginative use of material"; "the
    invention of the knitting frame by another ingenious English clergyman"- Lewis Mumford; "an ingenious device"; "had an inventive turn of mind";
    "inventive ceramics"

expletives used informally as intensifiers; "he's a blasted idiot"; "it's a blamed shame"; "a blame cold winter"; "not a blessed dime";
    "I'll be damned (or blessed or darned or goddamned) if I'll do any such thing"; "he's a damn (or goddam or goddamned) fool"; "a deuced idiot";
    "an infernal nuisance"
